import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

    <div className="App-logo">
       return <img src={"./opm.png"} alt="Mr. Saitama" />;
    </div>

      <header className="App-header">

        <p>
          Hey, I'm <b>Aedriane</b>.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>







      </header>
    </div>
  );
}

export default App;
